		"id_str": "876657632727015424",
		"in_reply_to_user_id": 4531360753,
		"text": "\"하지만 이는 현 정책체제하에서의 미봉책일뿐 향후 문체부, 대중음악산업계 등과 충분하게 상의하여 새로운 차트 카테고리의 개발 등 뉴미디어 상품이 보다 일관성있게 차트에 반영될 수 있게 조치하겠습니다.\"",
