		"geo": {},
		"id_str": "876657567224668161",
		"in_reply_to_user_id": 4531360753,
		"text": "\"향후 YG엔터테인먼트측과 업무 협조를 통해 이와 관련된 데이터를 받도록 협의를 진행하겠습니다. 본 상품의 가온지수내 다운로드의 가중치는 기존 다운로드 서비스와 동일하게 반영될 예정입니다.\"",
