		"geo": {},
		"id_str": "876657344683233280",
		"in_reply_to_user_id": 4531360753,
		"text": "\"둘째, 저희 가온차트는 이번 권지용 USB를 저작권법상 전송(다운로드 서비스)이라고 판단했습니다. 고로, 상기 상품은 디지털 차트와 다운로드 차트에 반영할 것입니다.\"",
		"id": 876657344683233300,
