		"geo": {},
		"id_str": "876657219554623488",
		"in_reply_to_user_id": 4531360753,
		"text": "\"그렇기 때문에 2010년부터 유지해왔던 가온차트의 주요 정책들이 이제는 새로운 미디어가 보다 신속하게 반영됨이 옳지만 이번 결정은 기존 규정내에서 정책적 판단을 했음을 알려드립니다.\"",
