		"geo": {},
		"id_str": "876657194350944256",
		"in_reply_to_user_id": 4531360753,
		"text": "\"새로운 형태의 뉴미디어나 이를 응용한 음악 신제품의 종류와 범위를 예측하기 어렵고 그 발전속도를 법/ 제도/ 정책이 따라가지 못하는 경우가 많습니다.\"",
