		"geo": {},
		"id_str": "876656995197100033",
		"in_reply_to_user_id": 4531360753,
		"text": "\"이는 개정 저작권법처럼 ‘디지털 음원’까지 모두 ”음반“으로 정의하게 되면 현재 유지되고 있는 가온차트의 디지털 차트 및 다운로드 차트와 앨범차트의 경계가 허물어지는 사태가 벌어지고 마는 것입니다.\"",
		"id": 876656995197100000,
		"in_reply_to_status_id": 876656493390581800,
		"created_at": "2017-06-19 04:24:49 +0000",
		"in_reply_to_screen_name": "fromminn",
