		"in_reply_to_user_id": 4531360753,
		"text": "\"다만 가온차트의 ‘앨범’의 정의는 ‘음반’의 정의와 다르며, 음이 유형물에 고정된 것만으로 한정합니다.(이에 대한 정확한 집계 기준에 대해서 구체적 적시가 없었음을 양해드립니다)\"",
