		"text": "인디소비자가 시스템을 비판하고 건의해서 개선하는 것이 아닌 아이돌 후려치기를 해서 음악의 우월성을 주장하는 것 좀 그만봤으면. 하나만 하던가 인격까지 후려치는 건 뭐지... 그럴거면 본인 삶이나 신경쓰며 열심히 사세요!",
