		"text": "\"(음악이야기) 때론 거의 일반인 트위터 사용자처럼 느껴질 때마저 있는 한두 마디가 각별한 의미를 얻는다. 중심 콘텐츠는 분명 음반이다. 하지만 그것이 태어나는 장소는 소셜 미디어상의 부가 콘텐츠에서 엿보이는 일상과 작업이다.\"",
		"id": 875726985317593100,
		"in_reply_to_status_id": 875726389281923100,
