		"in_reply_to_user_id": 4531360753,
		"text": "\"멤버 각자가 출신지의 방언을 주고받거나, 자신들이 거쳐온 지명을 직접 거론하는 등의 요소들은 마치 다큐멘터리 같은 생생함을 준다.\"",
