		"id_str": "875726189221904385",
		"in_reply_to_user_id": 4531360753,
		"text": "\"여기서 더 중요한 것은 소셜 콘텐츠가 방탄소년단이란 ‘플랫폼’과 맺는 관계다. 소위 ‘힙합 아이돌’로서, 작사·작곡·프로듀싱을 직접 해낸다. 그러나 소재와 기법이 ‘리얼’을 강조하고 누구보다 ‘내 이야기’를 하는 팀이란 점이 유독 두드러진다.\"",
