		"text": "RT @mimyo_: USB여야 했던 이유라면 \"(남들 보니) USB 음반을 내보고 싶어서\"...일 뿐일 가능성이 가장 높아 보인다. 거기엔 별로 나쁘다고 할 것은 없다. 다만 지디가 USB로 음반을 내면 한국 미디어들이 와 지디 역시 최첨단 이럴…",
