		"geo": {},
		"id_str": "874911215436398592",
		"in_reply_to_user_id": 4531360753,
		"text": "\"사진은 이틀 뒤인 12일 오전 11시가 돼서야 제공됐습니다. 단 두 장으로, 그마저도 한 장은 스피어스의 얼굴이 나오지도 않았죠. 온라인 매체들은 뒤늦게 사진을 교체했지만, 신문 매체의 경우 이미 인쇄된 지면을 되돌릴 순 없었습니다.\"",
		"id": 874911215436398600,
		"in_reply_to_status_id": 874911130296217600,
