		"id_str": "874911130296217600",
		"in_reply_to_user_id": 4531360753,
		"text": "\"iMe KOREA에 따르면 “기다리라”는 답변만 돌아왔다고 합니다. 이유도 모른 채 스피어스 측의 최종 확인을 기다리던 기자들은 결국 일주일 전 일본 공연 사진을 제공 받아 기사를 작성했습니다.\"",
		"id": 874911130296217600,
