		"geo": {},
		"id_str": "874911020623507456",
		"in_reply_to_user_id": 4531360753,
		"text": "\"스피어스는 공연 후에도 불성실한 태도로 업계 관계자들의 입장을 난처하게 했습니다. 국내 언론사들의 기사에 반영해야 할 현장 사진을 최종 확인하지 않은 채 대만에 가는 비행기에 탑승한 것이죠.  (이어서)\"",
