		"in_reply_to_user_id": 4531360753,
		"text": "\"10만원 이상의 금액을 내고 공연장을 찾은 유료 관객들은 결국 초대권 관객과 섞여 앉아 무대를 봐야 했습니다. 이 혼선 때문에 공연은 20분 늦게 시작됐습니다.\"",
