		"text": "\"공연장의 빈 좌석 수를 채우느라 주최 측은 이날 급하게 초대권을 풀었습니다. 그런데 이 초대권 좌석이 유료 관객 좌석과 뒤섞이면서 좌석이 겹치는 ‘사고’가 발생했습니다.\"",
