		"in_reply_to_user_id": 4531360753,
		"text": "\"이와 달리 한터차트 측은 “‘키노 앨범’도 음반으로 봐 음반판매량을 집계하고 있다”며 “‘권지용’ USB도 같은 이유로 앨범에 해당한다고 본다”고 말했다. 키노 앨범은 휴대폰이나 컴퓨터에서 사용할 수 있도록 스마트 카드 형태로 제작된 매체다.\"",
