		"text": "\"가온차트 측이 ‘권지용’ USB를 음반으로 보지 않는 배경엔 저작권 규정이 있다. 매체에 음원을 고정해야 음반이라고 보는데, 매체 안에 음원이 고정된 게 아니라 온라인에서 다운을 받아야 하기 때문에 음반으로 볼 수 없다는 설명이다.\"",
