		"geo": {},
		"id_str": "874671855063359488",
		"in_reply_to_user_id": 4531360753,
		"text": "\"사용자가 직접 음악을 감상하거나 선호도를 표명한 콘텐츠에 대한 이력을 기반으로 하는‘협업 필터링(Collaborative Filtering)’, (이어서)\"",
		"id": 874671855063359500,
		"in_reply_to_status_id": 874671586971754500,
		"created_at": "2017-06-13 16:56:35 +0000",
