		"geo": {},
		"id_str": "874671586971754499",
		"in_reply_to_user_id": 4531360753,
		"text": "\"음악 추천을 위한 기계적인 알고리즘은 크게 플레이리스트, 태그, 곡 제목 등 음악과 관련된 메타정보를 기반으로 하는‘메타 기반 필터링(Meta Based Filtering)’, (이어서)\"",
		"id": 874671586971754500,
		"in_reply_to_status_id": 874670575683162100,
		"created_at": "2017-06-13 16:55:31 +0000",
