		"geo": {},
		"id_str": "874670575683162112",
		"in_reply_to_user_id": 4531360753,
		"text": "\"소비자들은 음원 플랫폼의 메인 화면에 노출된 음원이나 차트에 진입한 콘텐츠와 같이 좀 더 접근이 쉬운 콘텐츠 위주의 소비경향을 보였고, 이 과정에서 선택된 콘텐츠들의 선정 과정과 기준이 공정한 것인지에 대한 논란에 휩싸이기도 했다.\"",
		"id": 874670575683162100,
		"in_reply_to_status_id": 874669928388771800,
		"created_at": "2017-06-13 16:51:30 +0000",
