		"text": "서늘한 마음썰 4화는 듣기 넘 힘들었다. 지금 상황 때문인지 기분 때문인지 듣는내내 넘 우울했음. 외롭다는 것, 어떤 이야기를 들어줄 사람이 필요하다는 것. 다 알지만... 다 알고 있지만...",
