		"text": "《2016 음악산업백서》 '음악감상 시, 이용기기 (복수응답 가능)' 인포그래픽을 보면 LP 이용자가 0.8%. 한국에서 바이닐이 디지털 시장을 뛰어넘는 건 불가능하다고 생각함. https://t.co/e4nAztUyxK",
