		"in_reply_to_user_id": 4531360753,
		"text": "\"바이닐 시장이 일시적으로 호황을 누릴 경우 영국의 예처럼 디지털 시장의 매출을 일시적으로 능가할 가능성이 아예 없는 것은 아니다.\"",
