		"text": "한국에도 드디어 새로운 레코드 공장이 생겼는데, 마장뮤직앤픽처스에서 운영하는 '바이닐팩토리'는 국내 기술로 생산한 새로운 프레싱 기계와 국내산 PVC 재료, 과거 엔지니어들의 기술 전수 등을 바탕으로 17년 6월부터 새로운 레코드를 선보이기 시작했다. https://t.co/RmdIvwGhjL",
