		"text": "그리고 대행사 트위터 계정부터 만들고 페이스북 광고도 하고 영상도 올리고 검색엔진최적화를 통해 노출도 열심히 했어야한다. 브리트니 내한 대행사는 일 못한 거 맞다.",
		"id": 873164288331993100,
		"in_reply_to_status_id": 873163795031441400,
		"created_at": "2017-06-09 13:06:03 +0000",
		"in_reply_to_screen_name": "fromminn",
		"in_reply_to_user_id_str": "4531360753",
