		"geo": {},
		"id_str": "873163795031441409",
		"in_reply_to_user_id": 4531360753,
		"text": "그런 건의가 왔다면 어떤 방식으로 더 홍보하고 구매까지 이어지게 할 지 고민해야한다. 여러 채널을 이용하고 있다고 해서 끝나는게 아니고 소셜미디어를 어떻게 활용할 것인지 논의해 피드백 해야한다.",
		"id": 873163795031441400,
		"in_reply_to_status_id": 873163157774123000,
		"created_at": "2017-06-09 13:04:05 +0000",
