		"text": "아침출근길은 지옥인데 거기서 종이신문은 거슬릴 뿐이다. 서서 보기 힘들다. 한 손은 손잡이를 잡고 한 손으로 볼 수 없다. 행간을 음성으로 읽어주기도하고 요약된 뉴스를 제공하는 팟캐스트도 있다. 또한 소수의 관점으로 본다는 것도 큰 오해다.",
