		"text": "\"데이트 강간 약물로 사용되는 케타민(마취 유도제)과 GHB(마약류의 일종)를 감지한다. 알코올 또는 무알콜 음료에 빨대를 꽂았을 때 약물이 들어있지 않으면 빨대 색상은 변하지 않는다. 하지만 약물이 들어있을 경우 빨대가 파란색으로 변색된다.\"",
