		"text": "주변에 어떤 사람이 있는지 좋은 사람들인지가 큰 영향을 주겠지... 그를 믿고 지지하고 응원하고 도와준 조 같은 친구를 곁에 둔 건 큰 부러움이고 큰 행복이겠구나 싶었다. 둘이 나누는 대화는 많은 걸 시사했고 그 부분에 자주 울컥했다.",
